* {
  font-family: "Roboto", sans-serif;
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  scroll-behavior: smooth;

}

:root {
  --text-left-color: #797979;
  --text-color: #303030;
  --text-size-xs: 1.3vw;
  --text-size-sm: 2vw;
  --text-size-md: 3.5vw;
  --text-size-lg: 6vw;
  --text-size-lg-mb: 10vw;
  --background: #E9E9E9;
}

body {
  height: 1500px;
  color: var(--text-color);
}

body::-webkit-scrollbar {
  display: none;
}

.second-scroll {
  opacity: 0;
}

.third-scroll {
  opacity: 0;
}

.fourth-scroll {
  opacity: 0;
}

.fifth-scroll {
  opacity: 0;
}


/* mobile view */

@media (max-width: 800px) {
  .container {
    overflow-x: hidden;
  }

  .top-left-sticky {
    display: none;
  }

  .top-right-sticky {
    display: none;
  }

  body .big-name-container {
    position: absolute;
    margin-top: 10vh;
    margin-left: 5vw;
    display: flex;
  }

  body .big-name {
    font-size: 12vw;
    opacity: 1;
  }

  body .bottom-right {
    position: absolute;
    top: 10px;
    right: 7vw;
    display: flex;
    flex-direction: row-reverse;
  }

  body #code {
    width: 10vw;
  }

  body #link {
    color: var(--text-color);
    font-size: var(--text-size-lg);
    text-decoration: underline;
    margin-top: 1vh;
  }

  body .arrow {
    display: none;
  }

  .second-scroll {
    opacity: 1;
  }

  .third-scroll {
    opacity: 1;
  }

  .fourth-scroll {
    opacity: 1;
  }

  .fifth-scroll {
    opacity: 1;
  }

  body .second-page {
    margin-top: 50%;
    display: flex;
    flex-direction: column;
  }

  body .about-text {
    font-size: var(--text-size-lg);
  }

  body .blog { 
    margin-top: 20%;
  }

  body .blog-box {
    display: flex;
    justify-content: center;
  }

  /* third page */

  body .skill-container {
    margin-top: 20%;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
  }

  body .box {
    width: 90vw;
    height: 10vw;
    margin: 1vw;
    background-color: var(--background);
    padding-top: 0;
    font-size: var(--text-size-lg-mb);
    text-align: center;
  }

  body .skills-text {
    width: 90vw;
    margin: auto;
    margin-top: 10vw;
    font-size: var(--text-size-lg);
  }

  /* fourth page */

  body .projects-container {
    margin-top: 20%;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
  }

  body .project-box {
    width: 90vw;
    height: 40vw;
    background-color: var(--background);
    margin: 1vw;
    display: flex;
  }

  body .project-img {
    width: 45vw;
    height: 96%;
    border: 1px solid lightgray;
    margin: 2px;
  }

  body .project-head {
    font-size: var(--text-size-lg-mb);
    margin-left: 6vw;
  }

  body .info-more > p { 
    font-size: var(--text-size-md);
    margin: auto;
  }

  body .github,
  body .live {
    margin: 3vw;
  }

  body .info-links a img{
    margin-top: 1vw;
    width: 12vw;
    height: 12vw;
  }

  a {
    z-index: 9999;
  }

  /* fifth page */ 

  body .fifth-scroll {
    margin-top: 20%;
  }

  body #big {
    font-size: var(--text-size-lg-mb);
    color: var(--text-color);
  }

  body #mid {
    font-size: var(--text-size-lg);
    color: var(--text-color);
    margin-top: 4vw;
  }

  body #sm {
    font-size: var(--text-size-md);
    color: var(--text-left-color);
    margin-top: 2vw;
  }

  body .contact-img-container {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
  }

  body .contact-img {
    width: 15vw;
    margin: 10vw;
  }

  body .contact-notes {
    margin-top: 10vw;
    display: flex;
    flex-direction: column;
    text-align: center;
    font-size: var(--text-size-lg);
    width: 90vw;
    margin: auto;
  }
}

/* first page */
.top-left-sticky {
  position: fixed;
  top: 25px;
  margin-left: 25px;
  font-size: var(--text-size-sm);
  color: var(--text-left-color);
}

.top-right-sticky {
  width: 420px;
  position: fixed;
  top: 25px;
  right: 50px;
  text-align: right;
  font-size: var(--text-size-md);
}

.big-name-container {
  margin-top: 10vh;
  display: flex;
  justify-content: center;
}

.big-name {
  font-size: 8vw;
  margin: 0.5vw;
  opacity: 0;
}


.bottom-right {
  position: absolute;
  display: flex;
  flex-direction: column;
  justify-content: center;
  top: 80%;
  right: 20px;
}

#code {
  width: 100px;
  margin: auto;
}

#link {
  color: var(--text-color);
  font-size: var(--text-size-sm);
  text-decoration: underline;
}

.arrow {
  position: absolute;
  top: 80%;
  left: 49%;
  transform: rotate(90deg);
}

#scroll {
  height: 80px;
}


/*second page */


.second-page {
  margin-top: 20%;
  margin-left: 10%;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}

.about-text {
  color: var(--text-color);
  font-size: var(--text-size-sm);
}

.blog { 
  font-size: 24px;
  margin-right: 50px;
}

.blog-box {
  border: 10px solid black;
  height: 100px;
  margin-top: 10px;
  text-align: center;
}

#blog-link {
  font-size: 68px;
  font-weight: 700;
  color: black;
  text-decoration: none;
}

/* third page */

.skill-container {
  margin-top: -16%;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
}

.box {
  width: 13vw;
  margin: 1vw;
  height: 13vw;
  background-color: var(--background);
  padding-top: 4vw;
  font-size: var(--text-size-md);
  text-align: center;
}

.skills-text {
  text-align: center;
  font-size: var(--text-size-sm);
  margin: 1vw;
}

/* fourth page */

.projects-container {
  margin-top: -30%;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
}

.project-box {
  width: 36vw;
  height: 16vw;
  background-color: var(--background);
  margin: 2vw;
  display: flex;
}

.project-img {
  width: 20vw;
  height: 98%;
  border: 1px solid lightgray;
  margin: 2px;
}

.project-head {
  font-size: var(--text-size-md);
  margin-left: 3vw;
}

.info-more {
  margin-top: 5vw;
  margin-left: 2.5vw;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
}

.info-more > p { 
  font-size: var(--text-size-xs);
}

.github a img,
.live a img {
  width: 3vw;
  height: 3vw;
  margin: 1vw;
}

.info-links {
  display: flex;
}

a {
  z-index: 9999;
}

/* fifth page */ 

.fifth-scroll {
  margin-top: -35%;
}

.contact-text {
  display: flex;
  flex-direction: column;
  text-align: center;
}

#big {
  font-size: var(--text-size-lg);
  color: var(--text-color);
}

#mid {
  font-size: var(--text-size-sm);
  color: var(--text-color);
  margin-top: 4vw;
}

#sm {
  font-size: var(--text-size-sm);
  color: var(--text-left-color);
  margin-top: 2vw;
}

.contact-img-container {
  display: flex;
  justify-content: center;
}

.contact-img {
  width: 50px;
  margin: 50px;
}

.contact-notes {
  margin-top: 50px;
  display: flex;
  flex-direction: column;
  text-align: center;
  font-size: var(--text-size-sm);
}

.contact-notes > p {
  margin: 10px;
  letter-spacing: 4px;
}
